import React, { useState } from 'react';
import { Form, Modal, Row, Col } from 'react-bootstrap';

function ModalWindow(props) {
    const [showFlag, setShowFlag] = useState(props.showFlag);
    return (
        <Modal show={showFlag} onHide={() => setShowFlag(false)}>
            <Modal.Header closeButton>
                <Modal.Title>Sign in</Modal.Title>
            </Modal.Header>
            <Modal.Body as={Row} className='text-center'>
                <Form as={Col} className='w-50'>
                    <Form.Group>
                        <Form.Control type="text" placeholder="Type login" />
                    </Form.Group>
                </Form>
                <Form as={Col} className='w-50'>
                    <Form.Group>
                        <Form.Control type="text" placeholder="Type login" />
                    </Form.Group>
                </Form>
                <Form as={Col} className='w-100'>
                    <Form.Text className="text-muted">
                        Press enter when you have already typed
                        </Form.Text>
                </Form>

            </Modal.Body>
        </Modal>
    );
}

export default ModalWindow;
